import React from 'react';
import s from "./Dialogs.module.css"
import {NavLink} from "react-router-dom";



const DialogItem = (props)=>{
    return(
        <div className={s.dialog +' '+s.active}>
            <NavLink to={"/dialogs/"+props.id}>{props.name}</NavLink>
        </div>
    )
}
const Message = (props)=>{
    return(
        <div className={s.message}> {props.msg}</div>
    )
}
const Dialogs = (props)=>{
    dialogsData = [
        {id:1,name: "Andrey"},
        {id:2,name: "Alexandr"},
        {id:3,name: "Darya"},
        {id:4,name: "Ivan"},
    ]


    return(

            <div className={s.dialogs}>
                <div className={s.dialogsItems}>
                    <DialogItem name={"Andrey"} id={"1"}/>
                    <DialogItem name={"Alexandr"} id={"2"}/>
                    <DialogItem name={"Darya"} id={"3"}/>
                    <DialogItem name={"Ivan"} id={"4"}/>

                </div>
                <div className={s.dialogsMessage}>
                    <Message msg={"Hello"}/>
                    <Message msg={"How are you, man?"}/>
                    <Message msg={"What interestind in your life?"}/>
                    <Message msg={"I'm glad to hear you!"}/>
                </div>
            </div>

    )
}
export default Dialogs;
